INSERT INTO `product` (`id`, `name`, `quantity`, `imageUrl`, `originalPrice`, `discount`, `price`, `detail`, `type`, `categoryId`) VALUES
(1, 'Anahaim 85\'\' Upholstered Sleeper Sofa', 99, 'https://secure.img1-cg.wfcdn.com/im/19996727/resize-h800-w800%5Ecompr-r85/2382/238244658/Anahaim+85%27%27+Upholstered+Sleeper+Sofa.jpg', 455, 0, 455, 'his L-shaped pull-out sleeper sectional is ideal for adding a cozy, casual touch to spaces of all sorts. It\'s made from a manufactured wood frame and is upholstered in linen fabric in the neutral hue of your choice, so it\'s easy to pair with a variety of different color palettes. This sofa features plush back cushions and medium-firm seat cushions, plus two toss pillows with tufted back cushions. Best of all, the chaise features lift-up storage inside, so you can keep spare sheets, pillows, and blankets ready for your out-of-town guests.', 'Sofa', 2),
(2, 'Forbestown 7 - Piece Upholstered Sectional', 99, 'https://secure.img1-cg.wfcdn.com/im/55169991/resize-h800-w800%5Ecompr-r85/1109/110965743/Forbestown+7+-+Piece+Upholstered+Sectional.jpg', 1229, 7, 1149, 'With unlimited possible options, this sectional features superior linen upholstery, cushion back, and seat cushion. This sectional is completely modular so you can create the living room for your comfort needs.', 'Sofa', 2),
(3, 'Williamsbridge 2 - Piece Living Room Set', 5, 'https://secure.img1-cg.wfcdn.com/im/16279431/resize-h800-w800%5Ecompr-r85/1009/100949591/Williamsbridge+2+-+Piece+Living+Room+Set.jpg', 1099, 46, 589, 'Offer your home a centerpiece of exceptional design and texture to create an atmosphere of refinement throughout your interior decor. Plush upholstery and sloped arms. This sofa stands as a streamlined statement piece that can change the whole flow of your interior decor. Whether you\'re adding to an existing seating group or looking to anchor a smaller living room, this sofa is a tasteful addition to your space. This sofa is crafted with a manufactured wood frame and filled with foam for a medium-firm feel cushion giving this streamlined silhouette a touch of texture.  Round out the design with a hint of mid-century style and gather the family atop this stylish Curved Arm sofa to make the evening entertaining. this sofa will bring excellent comfort and style to any room.', 'Living Room Set', 2),
(4, 'Adelaide Living Room Set', 90, 'https://secure.img1-cg.wfcdn.com/im/78662433/resize-h800-w800%5Ecompr-r85/1948/194817846/Adelaide+Living+Room+Set.jpg', 940, 15, 800, 'Perfect for an apartment or studio, this modern style sofa and loveseat set offer a chic and comfortable place to relax at the end of the day. The set is upholstered in velvet elevate the style of your living room. Stylish colors match any home decor and simply wipe down with clean cloth.', 'Living Room Sets', 2),
(5, '71\'\' Wide Adjustable Arms Tufted Back Convertible Faux Leather Twin Size Sofa', 5, 'https://secure.img1-cg.wfcdn.com/im/25180022/resize-h700-w700%5Ecompr-r85/2147/214718527/71%27%27+Wide+Adjustable+Arms+Tufted+Back+Convertible+Faux+Leather+Twin+Size+Sofa.jpg', 315, 12, 277, 'This convertible sofa can be adjusted at any angle according to your needs, even turned into a twin-size bed when you need it. This convertible sofa is made of faux leather, so it is convenient for daily cleaning and also can be worry-free for a long time using. The sofa is a very suitable choice for the situation of unexpected visitors.', 'Sofa', 2),
(6, 'Hambrick 23.6\'\' Tall 1 - Drawer Nightstand (Set of 2)', 88, 'https://secure.img1-cg.wfcdn.com/im/35965003/resize-h700-w700%5Ecompr-r85/2303/230399336/Hambrick+23.6%27%27+Tall+1+-+Drawer+Nightstand.jpg', 138, 11, 122, 'This 2-piece set of nightstands organizes your living room, bedroom, or both with a classic look and extra storage. Each is crafted from engineered wood in a smooth, neutral finish that goes with a variety of color schemes. The design features a rectangular silhouette with straight legs, and it has a tabletop with a built-in drawer for storing anything from journals to glasses to phone chargers. Plus, each of these end tables also has a lower, open shelf that\'s ideal for a stack of books or a decorative storage basket or bin.', 'Bedroom Set', 1),
(7, 'Lausyn Upholstered Standard 3 Piece Bedroom Set', 66, 'https://secure.img1-cg.wfcdn.com/im/88875698/resize-h700-w700%5Ecompr-r85/2399/239916704/Lausyn+Upholstered+Standard+3+Piece+Bedroom+Set.jpg', 459, 39, 279, 'Transform your bedroom into a chic and modern retreat with this stunning upholstered bed. The sleek black or navy blue frame is complemented by a stunning gold acrylic headboard design, adding a touch of glamour to your space. Accompanied by two matching nightstands, each with two drawers, this bed offers both style and functionality. Choose the perfect size to fit your room, and elevate your sleeping experience with this contemporary and sophisticated bed that is guaranteed to impress. Make a statement with this chic and modern bed, and enjoy a comfortable and stylish space for years to come.', 'Bedroom Set', 1),
(8, 'Brookside 6 Drawer Double Dresser', 68, 'https://secure.img1-cg.wfcdn.com/im/56622326/resize-h700-w700%5Ecompr-r85/1624/162483872/Brookside+6+Drawer+Double+Dresser.jpg', 279, 29, 199, 'The Storkcraft Brookside 6-Drawer Double Dresser is the perfect addition to any nursery or bedroom, with its modern look, easy-to-match style, and ample storage. Featuring slender metal handles and modern bracket feet, the Storkcraft Brookside 6-Drawer Double Dresser offers plenty of storage to help you keep your nursery or bedroom neat, tidy, and organized. Also, it features durable steel hardware and Euro-glide drawers with safety stops. For additional stylish storage, complete the Storkcraft Brookside collection with the Storkcraft Brookside 3-Drawer Chest, the Storkcraft Brookside 3-Drawer Combo Dresser, and the Storkcraft Brookside 4-Drawer Chest.', 'Dresser', 1),
(9, 'Crescent 6 Drawer Double Dresser', 86, 'https://secure.img1-cg.wfcdn.com/im/40111180/resize-h700-w700%5Ecompr-r85/2179/217977969/Crescent+6+Drawer+Double+Dresser.jpg', 279, 29, 199, 'The Storkcraft Crescent 6-Drawer Double Dresser is a universal nursery and bedroom storage solution featuring stylish metal knobs for an added modern flare. Crafted with engineered wood, this durable double dresser features 6 spacious drawers, durable steel hardware, euro-glide drawers with safety stops, and is fastened with German cam locks for dependable and reliable construction. The Crescent is expertly tested by independent laboratories to guarantee this product meets the highest standards for your child’s safety and complies with all applicable federal anti-tipping standards.', 'Dresser', 1),
(10, 'Essex 53.1\'\' Wide 6 - Drawer Double Dresser', 19, 'https://secure.img1-cg.wfcdn.com/im/56622326/resize-h700-w700%5Ecompr-r85/1624/162483872/Brookside+6+Drawer+Double+Dresser.jpg', 379, 29, 202, 'Keeping up with your kid\'s wardrobe can be exhausting. Between birthdays, holidays, and clothing sales, storage space always seems to come at a premium. That\'s when this 6-drawer double dresser comes in handy. Crafted from solid wood, this piece features six large drawers, perfect for tucking away your little one\'s clothes or toys. Raised paneling and a clean-lined silhouette add to the traditional feel of this piece, which works well with any neutral color palette. You can also use this dresser to store diapers, toys, and other baby items.', 'Dresser', 1),
(11, '47.25\'\' Wide Rolling Kitchen Island', 55, 'https://secure.img1-cg.wfcdn.com/im/87471959/resize-h700-w700%5Ecompr-r85/1825/182571752/47.25%27%27+Wide+Rolling+Kitchen+Island.jpg', 199, 13, 173, 'Durable Rolling Kitchen Island Cart\r\nThis kitchen island is a great way to transform your kitchen without the mess or expense of a kitchen remodel! Loaded with space-saving features and adjustable storage options, it combines modern conveniences with a classic aesthetic.\r\n\r\nDrop leaf extends when more surface is needed and folds down to save space.\r\nMade of MDF board offers incredible structural strength and durability.\r\nCabinet with a 3-position adjustable shelf to satisfy your different needs.\r\nSpice and towel racks are convenient to put items for easy access.\r\nEasy to move with 4 360° swivel wheels, 2 with brakes.\r\nEasy to assemble with our easy-to-understand directions.', '', 3),
(12, 'Lorraine TV Stand for TVs up to 60\"', 39, 'https://secure.img1-cg.wfcdn.com/im/29666849/resize-h700-w700%5Ecompr-r85/1279/127927374/Lorraine+TV+Stand+for+TVs+up+to+60%22.jpg', 304, 51, 149, 'This TV stand has a charming, rustic aesthetic and provides your space with plenty of room. The frame is built from engineered wood. Each of the two cabinets opens to store media players, games, books, and other equipment, while the three open shelves give you a place to display your favorite decorative objects. We love how the barn doors add a farmhouse feel to your living room. Sliding doors and black hardware complete the country look. Plus, a cable management cutout on the back keeps your cords corralled.', '', 3),
(36, 'Dineisha 31.5\'\' Wide Curio Cabinet', 11, 'https://secure.img1-cg.wfcdn.com/im/62236494/resize-h700-w700%5Ecompr-r85/2383/238377111/Dineisha+31.5%27%27+Wide+Curio+Cabinet.jpg', 399, 10, 359, 'This hutch cabinet is so simple and classic that it can be placed in any space of your home, such as study, kitchen, living room, or bedroom. The Display Cabinet comes with 3 tiers shelf this storage cabinet will provide spacious space for your items.', '', 3),
(37, 'Braelin 31.5\'\' Wrought Iron Standard Baker\'s Rack with Microwave Compatibility', 99, 'https://secure.img1-cg.wfcdn.com/im/92653975/resize-h755-w755%5Ecompr-r85/1243/124384417/Braelin+31.5%27%27+Wrought+Iron+Standard+Baker%27s+Rack+with+Microwave+Compatibility.jpg', 173, 13, 151, 'This baker\'s rack gives you plenty of space in your kitchen to organize appliances and utensils and have them in one spot. It has an industrial-inspired black wrought iron frame that holds all of the wooden shelves in place. Three bottom shelves and two top ones provide you with all the room you need for all of your storage and food prep needs. There\'s also a spot to hold a microwave or a toaster oven along with other larger-sized kitchenware. It\'s also safe to keep outdoors, in your garage, or on your patio.', '', 3);

